import rock4 from '../assest/Group 4.png';
import rock5 from '../assest/rock-removebg-preview 2.png';

function Head2() {
  return (
    <div className='dis'>
      <div className='pics'>
         <img src={rock4} alt='2' />
         <img src={rock5} alt='2' />
      </div>
      <div className='content'>
          <h3>HOW CAN I <span>Join</span> ?</h3>
          <p>No matter if you want to make a background transparent (PNG) or add all this and more with remove.bg.No matter if you want to make a background transparent (PNG) or add all this</p>
          <a> Join us <img src={tab} alt='8' /></a>
      </div>
    </div>
  )
}

export default Head2
